import FocusedProfileContent from "./focusedProfileContent"
import SimpleBarReact from 'simplebar-react';

// Extends Focused //
export default function FocusedProfile({style, focusedItem}) {
  return (
    <div style={style.focusedProfileContainer}>
      <div style={style.focusedSubTitle}>Profile</div>

      <SimpleBarReact style={style.profileContentContainer}>
          <FocusedProfileContent itemObject={focusedItem.data}/>
      </SimpleBarReact>
    </div>
  )
}
